  }).then(function (_admins) {
    // return fetch(`/bo/webauthn/admins`, {
    return fetch("/bo/api/proxy/api/admins/webauthn", {
      method: 'GET',
      credentials: 'include',
      headers: {
        Accept: 'application/json'
      }
    }).then(function (r) {
      return r.json();
    }).then(function (_webauthnadmins) {
      var admins = _admins.map(function (admin) {
        return _objectSpread({}, admin, {
          type: 'SIMPLE'
        });
      });

      var webauthnadmins = _webauthnadmins.map(function (admin) {
        return _objectSpread({}, admin, {
          type: 'WEBAUTHN'
        });
      });

      return [].concat(_toConsumableArray(webauthnadmins), _toConsumableArray(admins));
    });
  });
}

